package src.LEETCODE;

import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class leet_242 {
	
	public static void main(String[] args) {
		String s = "";
		String t = "";
		System.out.println(isAnagram(s,t));
	}


	public static boolean isAnagram(String s, String t) {
		if(s.length() != t.length()) return false;

		Map<Character, Integer> countCharS = new HashMap<>();
		Map<Character, Integer> countCharT = new HashMap<>();

		for(int i=0; i<s.length(); i++){
			countCharS.put(s.charAt(i), countCharS.getOrDefault(s.charAt(i),0)+1);
			countCharT.put(t.charAt(i), countCharT.getOrDefault(t.charAt(i),0)+1);
		}

		for(Character key : countCharS.keySet()){
			if(countCharT.get(key) == null){
				return false;
			}
			if(countCharS.get(key).intValue() != countCharT.get(key).intValue()){
				return false;
			}
		}

		return true;
	}
	
}
